import{_ as t,c as e,o as r,ah as i,b9 as o,ba as l,bb as s,bc as c,bd as n,be as d,bf as h,bg as m,bh as g,bi as b,bj as _,bk as f,bl as x,bm as P,bn as k,bo as u,bp as w,bq as y,br as T,bs as H,bt as I,bu as L,bv as M,bw as q,bx as v,by as A,bz as S,bA as B,bB as C,bC as E,bD as p,bE as $,bF as D,bG as F,bH as N}from"./chunks/framework.Cjl4x9kA.js";const Q=JSON.parse('{"title":"HTML","description":"","frontmatter":{},"headers":[],"relativePath":"git/node4.md","filePath":"git/node4.md"}'),V={name:"git/node4.md"};function j(z,a,G,J,O,R){return r(),e("div",null,[...a[0]||(a[0]=[i('<h1 id="html" tabindex="-1">HTML <a class="header-anchor" href="#html" aria-label="Permalink to “HTML”">​</a></h1><h2 id="html简介" tabindex="-1">html简介 <a class="header-anchor" href="#html简介" aria-label="Permalink to “html简介”">​</a></h2><p>HTML是用来描述网页的一种语言，被称为超文本标记语言！用HTML编写的文件，后缀以.html结尾 TML是一种标记语言，标记语言是一套标记标签。标签是由尖括号包围的关键字。</p><p>文件后缀：必须使用.html作为文件扩展名</p><p><img src="'+o+'" alt="屏幕截图 2025-12-07 222737.png"></p><p>输入法状态：所有代码符号（特别是尖括号&lt;&gt;）必须在英文状态下输入 标签规范：标签必须成对出现，如<code>html</code> <code>/html</code></p><p>先输入！ 然后再按tab键可以快速生成html5文档</p><p>如下图是文档介绍</p><p>配置在head标签里面</p><p><img src="'+l+'" alt="截图"></p><h2 id="文档浏览" tabindex="-1">文档浏览 <a class="header-anchor" href="#文档浏览" aria-label="Permalink to “文档浏览”">​</a></h2><p><code>&lt;br/&gt;</code> 本地方式打开浏览插件</p><ol><li><p>搜索open in browser和live server</p><p><img src="'+s+'" alt="屏幕截图 2025-12-07 225449.png"></p><p><img src="'+c+'" alt="屏幕截图 2025-12-07 225532.png"></p></li><li><p>单击install 安装</p></li><li><p>重启vscode</p><br><p>**本地方式浏览 **地址栏：file://</p><p>例如：<code>file:///E:/hello/about.html</code></p><p><img src="'+n+'" alt="屏幕截图 2025-12-07 230335.png"></p><p><strong>服务器的方式浏览</strong> 地址栏：<code>http://127.0.0.1:5500</code> 或者 <code>http://localhost:5500</code><code>http://www.scnew.com.cn</code> 例如：<code>http://127.0.0.1:5500/about.html</code> 或者 <code>http://localhost:5500/about.html</code></p><p><img src="'+d+'" alt="屏幕截图 2025-12-07 230314.png"></p><p>127.0.0.1是指当前电脑本地IP localhost 是 127.0.0.1的别名</p><h2 id="基础标签" tabindex="-1">基础标签 <a class="header-anchor" href="#基础标签" aria-label="Permalink to “基础标签”">​</a></h2><h3 id="body标签" tabindex="-1"><strong>body标签</strong> <a class="header-anchor" href="#body标签" aria-label="Permalink to “body标签”">​</a></h3><p>身体 是写代码的地方</p><p><code>&lt;body&gt;&lt;/body&gt;</code> 外边距 8px 宽度是可视宽度 高度是内容的高度</p><p>body里面写代码自带8像素</p><h3 id="标题标签" tabindex="-1"><strong>标题标签</strong> <a class="header-anchor" href="#标题标签" aria-label="Permalink to “标题标签”">​</a></h3><p><code>h1</code> 标题 <code>/h1</code></p><p>有默认的上下边距 宽度自适应容器 高度是内容高度 不同的标题级别字号不同</p><p>大部分搜索引擎规定一个页面只能一个标题1</p><p>一共有6级标签</p><p><img src="'+h+'" alt="屏幕截图 2025-12-09 153504.png"></p><p><img src="'+m+'" alt="屏幕截图 2025-12-09 153450.png"></p><h3 id="标题标签-1" tabindex="-1">标题标签 <a class="header-anchor" href="#标题标签-1" aria-label="Permalink to “标题标签”">​</a></h3><p>这样写<code>title</code>标题<code>/title</code></p><p><img src="'+g+'" alt="屏幕截图 2025-12-09 153916.png"></p><p><img src="'+b+'" alt="截图"></p><h2 id="单双标签" tabindex="-1">单双标签 <a class="header-anchor" href="#单双标签" aria-label="Permalink to “单双标签”">​</a></h2><p><img src="'+_+'" alt="屏幕截图 2025-12-11 185311.png"></p><h3 id="段落标签" tabindex="-1">段落标签 <a class="header-anchor" href="#段落标签" aria-label="Permalink to “段落标签”">​</a></h3><p><code>p</code>段落<code>/p</code></p><p>有默认的上下边距</p><p>p标签不能包裹标题标签</p><p>p标签不能包含块级块级</p><p><code>br</code>是换行符</p><p><img src="'+f+'" alt="屏幕截图 2025-12-09 154155.png"></p><p><img src="'+x+'" alt="屏幕截图 2025-12-09 154211.png"></p><p><strong>注释快捷键ctrl+/</strong></p><p>效果如下图：</p><p><img src="'+P+'" alt="截图"></p><h3 id="链接" tabindex="-1">链接 <a class="header-anchor" href="#链接" aria-label="Permalink to “链接”">​</a></h3><p>链接</p><p>没有盒型数据，因为它是行内元素 默认颜色是蓝色加下划线</p><p>锚点链接，可以看成是空链接</p><p>也有返回顶部的功能</p><p>如下是a标签的常用用法</p><p><img src="'+k+'" alt="屏幕截图 2025-12-11 184619.png"></p><p><img src="'+u+'" alt="屏幕截图 2025-12-11 184710.png"></p></li></ol><p>红框里面是没有点击链接的颜色</p><h2 id="图像" tabindex="-1">图像 <a class="header-anchor" href="#图像" aria-label="Permalink to “图像”">​</a></h2><p>图像 <code>&lt;img src=&quot;img/1.jpg&quot;&gt;</code> 图像的宽高是图片自身的宽高 图像是单标签</p><p>网站中最多的元素 网站中最多的元素毋庸置疑，一定是图片，<code>&lt;img&gt;</code>标签定义HTML页面中的图像。</p><p><img src="'+w+'" alt="屏幕截图 2025-12-11 185940.png"></p><p>注意：<code>&lt;img&gt;</code>是单标签，不需要进行闭合操作</p><p>属性： 1.src：路径 (图片地址与名字) 2.alt：规定图像的替代文本 3.width：规定图像的宽度 4.height：规定图像的高度 5.title：鼠标悬停在图片上给予提示</p><h2 id="图片路径" tabindex="-1">图片路径 <a class="header-anchor" href="#图片路径" aria-label="Permalink to “图片路径”">​</a></h2><p>绝对路径</p><p>绝对路径是电脑的盘符存储与访问的具体地址</p><p><img src="'+y+'" alt="屏幕截图 2025-12-11 190258.png"></p><p>相对路径 两者相对关系，两者在同一路径下可以直接访问 1.子级关系：/ 2.父级关系：../ 3.同级关系：./</p><p>网络路径 具体的网络地址：http:/wenwiki.com/api/newworld/images/n1png</p><h2 id="标签属性" tabindex="-1">标签属性 <a class="header-anchor" href="#标签属性" aria-label="Permalink to “标签属性”">​</a></h2><p>html5规定标签名一律小写 htm5不区分大小写</p><p>属性定义注意事项： 1.属性名小写 2.属性值要用双引号包裹 3.属性名必须是字母开头，不能使用空格或者其 他除下划线、中横杠以外的特殊字符</p><p>公共属性 每一个标签都可以定义的属性：</p><p>1.id定义唯一标识 2.class定义类名 3.name定义名称 4.style定义行内样式 5.title定义划过气泡提示</p><h2 id="文本标签" tabindex="-1">文本标签 <a class="header-anchor" href="#文本标签" aria-label="Permalink to “文本标签”">​</a></h2><p>常用文本标签</p><p><img src="'+T+'" alt="屏幕截图 2025-12-11 190607.png"></p><p>特别提示 常用文本标签和段落是不同的，段落代表一段文本，而文本标签一般表示文本词汇</p><h2 id="有序列表" tabindex="-1">有序列表 <a class="header-anchor" href="#有序列表" aria-label="Permalink to “有序列表”">​</a></h2><p>有序列表 有序列表是一列项目，列表项目使用数字进行标记。有序列表始于<code>&lt;ol&gt;</code>标签。每个列表项始于<code>&lt;li&gt;</code>标签。</p><p><img src="'+H+'" alt="屏幕截图 2025-12-11 190755.png"></p><p>type属性</p><p><code>&lt;ol&gt;</code>的属性type拥有的选项 1.1表示列表项目用数字标号（1,2,3.…） 2.a表示列表项目用小写字母标号(a,b,c…) 3.A表示列表项目用大写字母标号（A,B,C…） 4.ⅰ表示列表项目用小写罗马数字标号(，ii,ii.…) 5.表示列表项目用大写罗马数字标号(I,II,III.…)</p><p>有序列表嵌套 列表是可以进行嵌套（多次嵌套）的</p><p><img src="'+I+'" alt="屏幕截图 2025-12-11 190907.png"></p><p>有序标签效果</p><p><img src="'+L+'" alt="屏幕截图 2025-12-11 190948.png"></p><h2 id="无序标签" tabindex="-1">无序标签 <a class="header-anchor" href="#无序标签" aria-label="Permalink to “无序标签”">​</a></h2><p>无序列表实现 无序列表是一个项目的列表，此列项目使用粗体圆点（典型的小黑圆圈）进行标记 无序列表始于<code>&lt;ul&gt;</code>标签。每个列表项始于标签。</p><p><img src="'+M+'" alt="屏幕截图 2025-12-14 222220.png"></p><p><img src="'+q+'" alt="屏幕截图 2025-12-14 222151.png"></p><p>type属性<code>&lt;ul&gt;</code>的属性type拥有的选项 1.disc默认实心圆 2.circle空心圆 3.square小方块 4.none不显示</p><p>无序列表嵌套 列表是可以进行嵌套的</p><p><img src="'+v+'" alt="屏幕截图 2025-12-14 222236.png"></p><p><img src="'+A+'" alt="屏幕截图 2025-12-14 222249.png"></p><p>常见应用场景 1.无序的列表效果 2.导航效果 导航效果</p><p>快捷键 快速生成ul+li的布局：ul&gt;li*3(数字根据自己的需要的li数量修改)</p><h2 id="表格标签" tabindex="-1">表格标签 <a class="header-anchor" href="#表格标签" aria-label="Permalink to “表格标签”">​</a></h2><p>表格展示效果 表格在数据展示方面非常简单，并且表现优秀</p><p><img src="'+S+'" alt="屏幕截图 2025-12-14 222550.png"></p><p>表格组成与特点 行、列、单元格 单元格特点：同行等高、同列等宽。 表格标签 表格：<code>&lt;table&gt;</code> 行：<code>&lt;tr&gt;</code>单元格（列）：<code>&lt;td&gt;</code></p><p><img src="'+B+'" alt="屏幕截图 2025-12-14 222655.png"></p><p><img src="'+C+'" alt="屏幕截图 2025-12-14 222705.png"></p><p>快捷键 快速生成表格结构：table&gt;tr*2&gt;td</p><p>表格属性 1.border:设置表格的边框 2.width:设置表格的宽度 3.height:设置表格的高度</p><h2 id="合并单元格" tabindex="-1">合并单元格 <a class="header-anchor" href="#合并单元格" aria-label="Permalink to “合并单元格”">​</a></h2><p>单元格合并属性</p><p><img src="'+E+'" alt="屏幕截图 2025-12-14 222910.png"></p><p>水平合并：colspan 垂直合并：rowspan</p><p>挤掉</p><p><img src="'+p+'" alt="屏幕截图 2025-12-14 222930.png"></p><p>水平合并：保留左边，删除右边 垂直合并：保留上边，删除下边</p><p><img src="'+p+'" alt="屏幕截图 2025-12-14 222946.png"></p><p>先水平合并，在垂直合并</p><h2 id="form表单" tabindex="-1">Form表单 <a class="header-anchor" href="#form表单" aria-label="Permalink to “Form表单”">​</a></h2><h3 id="表单元素" tabindex="-1">表单元素 <a class="header-anchor" href="#表单元素" aria-label="Permalink to “表单元素”">​</a></h3><p>文本框 文本域通过<code>&lt;input type=&quot;text&quot;&gt;</code>标签来设定，当用户要在表单中键入字母、数字等内容时，就会用到文本域</p><p><img src="'+$+'" alt="屏幕截图 2025-12-14 223717.png"></p><p><img src="'+D+'" alt="屏幕截图 2025-12-14 223717.png"></p><p>密码框 密码字段通过标签<code>&lt;input type=&quot;password&quot;&gt;</code>来定义</p><p><img src="'+F+'" alt="屏幕截图 2025-12-14 223756.png"></p><p>温馨提示 密码字段字符不会明文显示，而是以星号或圆点替代</p><h2 id="块元素和行内元素-内联元素" tabindex="-1">块元素和行内元素(内联元素) <a class="header-anchor" href="#块元素和行内元素-内联元素" aria-label="Permalink to “块元素和行内元素(内联元素)”">​</a></h2><p>HTML5出现之前，经常把元素按照块级元素和内联元素来区分。在HTML5中，元素不再按照这种方式来区分，而是按照内容模型来区分，分为元数据型(metadata content)、区块型(sectioning content)、标题型(heading content)、文档流型(flow content)、语句型(phrasing content)、内嵌型（embedded content,、交互型(interactive content)。元素不属于任何一个类别，被称为穿透的，元素可能属于不止一个类别，称为混合的</p><h3 id="内联元素和块级元素的区别" tabindex="-1">内联元素和块级元素的区别 <a class="header-anchor" href="#内联元素和块级元素的区别" aria-label="Permalink to “内联元素和块级元素的区别”">​</a></h3><p><img src="'+N+'" alt="屏幕截图 2025-12-14 224241.png"></p><p>常见块级元素（换行，能够识别宽高） div、form、h1~h6、hr、p、table、ul、等 常见内联元素（行内元素）（换行，不识别宽高） a、b、em、i、span、strongs等</p><p>行内块级元素（特点：不换行、能够识别宽高） button、img、inputs等</p>',85)])])}const U=t(V,[["render",j]]);export{Q as __pageData,U as default};
